import React from 'react';

import './header.styles.css';


const Header = () => (
    <div>
        <div className="logo">
            Logo
        </div>

        <nav>
            <a href="#">Home</a>
            <a href="#">About</a>
            <a href="#">Contact</a>
        </nav>
    </div>
);

export default Header;
